import React from "react";
import { Link } from "react-router-dom";
import { data } from "./Userdata";
function Users() {
  const cardcontainer = {
    display: "grid",
    gridTemplateColumns: "1fr",
  };
  return (
    <div>
      <h1>Users</h1>
      {data.map((eachUser) => {
        const { id, name, email } = eachUser;
        return (
          <Link key={id}>
            <article className="card">
              <h3>{name}</h3>
              <h5>{email}</h5>
            </article>
          </Link>
        );
      })}
    </div>
  );
}
export default Users;
